import React from 'react';

const Products = ({ products }) => {
    return <div>
        <h1>Hello</h1>
        {products && products.map((product, index) => {
            <div key={index}> {product.name}</div>
            { console.log(typeof product) }
        })}
    </div>;
};

export default Products;
